<script>
  function addBaitElement() {
    var bait = document.createElement('div');
    bait.setAttribute(
      'class',
      'banner_ad block_ad blockad floatad footer_ad home_ad google_ad sponsor_ad side_ad'
    );
    bait.setAttribute(
      'style',
      'width: 1px !important; height: 1px !important; position: absolute !important; left: -10000px !important; top: -1000px !important;'
    );
    window.document.body.appendChild(bait);
    return bait;
  }

  function detectAdblocker(bait) {
    if (
      window.document.body.getAttribute('abp') !== null ||
      bait.offsetParent === null ||
      bait.offsetHeight === 0 ||
      bait.offsetLeft === 0 ||
      bait.offsetTop === 0 ||
      bait.offsetWidth === 0 ||
      bait.clientHeight === 0 ||
      bait.clientWidth === 0
    ) {
      return true;
    } else if (window.getComputedStyle !== undefined) {
      var baitTemp = window.getComputedStyle(bait, null);
      if (
        baitTemp &&
        (baitTemp.getPropertyValue('display') === 'none' ||
          baitTemp.getPropertyValue('visibility') === 'hidden')
      ) {
        return true;
      }
    }
    window.document.body.removeChild(bait);
    return false;
  }

  function adblockBeacon() {
    var bait = addBaitElement();
    var adblockbeacon = document.querySelector("#mnet-beacon");
    setTimeout(function() {
      if (detectAdblocker(bait)) {
        adblockbeacon.style.display = 'block';
      } else {
        adblockbeacon.style.display = 'none';
      }
    }, 1000);
  }

  (function($) {
    $(function() {
      $(document).ready(function() {
        adblockBeacon();
      });
    })
  })(jQuery);
</script>

<div id="mnet-beacon" style="position: fixed;top: 0;right: 0;bottom: 0;left: 0;z-index: 1050;display: none;overflow: hidden;outline: 0;background: rgba(0,0,0,0.6);">
  <div style="position: relative;display: flex;flex-direction: column;margin:auto;width: 480px;pointer-events: auto;background: #fff;background-clip: padding-box;border: 1px solid rgba(0, 0, 0, 0.2);border-radius: 0.3rem;outline: 0;box-shadow: 0 1px 3px 0 rgba(0,0,0,0.1);margin-top: 120px;">
    <div style="position: relative;flex: 1 1 auto;padding: 40px;text-align: center;">
      <article style="color: #3F4043;font-family: 'Open Sans';font-size: 16px;">Please deactivate <strong>Adblocker Extension</strong> from your browser</article>
      <img src="data:image/png;base64," alt="Adblock Beacon">
      <br />
    </div>
  </div>
</div>